import './App.css';
import Greet from './Components/Greet';
import Message from './Components/Message';

function App() {
  return (
    <div className="App">
      <Greet name = 'Rova' identity = 'Crush'/>
      <Message>
        <button> Change </button>
      </Message>
    </div>
  );
}

export default App;
